script: |
  super -f text -I q6503.spq | sort > q6503.out

inputs:
  - name: q6503.spq
    data: |
      SELECT DISTINCT - + col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 - - + col1 IN ( + col0, col1 + 3 + 60 * - - col2 + - + col2 + - + col2 );
  - name: tab0

outputs:
  - name: q6503.out
    data: |
      -15
      -87
      -97
